import { useContext } from "react";
import { AppContext } from "../context";



const Meals= () => {

    const {meals}= useContext(AppContext);
    console.log('1.',{meals});

    return (
        <section>
            {
                {meals}.map(meal => {
                    return (
                        <h4>{meal}</h4>
                    )
                })
            }
        </section>
    )
}

export default Meals;
